import React from "react";
import FriendCard from "./product/Product";
import friends from "./products.json";
import "./App.css";

class App extends React.Component{
  state = {
    product
  }

  render() {
    return (
    <Wrapper>
      <Title title= {'Product'}/>
      {this.state.product.map((f, index)=> {
        return(
          <Product
          removeFriend = {this.removeFriend}
          key = {index}
          id = {f.id}
          name={f.name}
          image={f.image}
          occupation={f.occupation}
          location={f.location}/>
        )
        })}
    </Wrapper>
  );
}
}


export default App;
